export function Ans() {
    //convert the inp value to number 
    let V1 = Number(this.Value1)
    let V2 = Number(this.Value2)

    //check operation condition
    if (this.add) {
        return V1 + V2;
    } else if (this.sub) {
        return V1 - V2;
    } else if (this.multi) {
        return V1 * V2;
    } else if (this.dev) {
        return V1 / V2;
    }
    return "";
}
